// // Contenido del popup para cada feature
function popupContentAgri(feature) {
    return (
        "<div id='Estilo1'><h3>Punto tomados de AGRI</h3></div>" +
        "<hr class='hrx' style='color: #ef7d26;' align='left' noshade='noshade' size='1' width='100%' />" +
        "<div id='Estilo3a'>" +
        "<div id='Estilo3a'>" +
        "<b> Número de identificación: </b>" + feature.properties.Name + "<br>" +
        "<b> Precipitación media (mm): </b>" + feature.properties.Precipitat + "<br>" +
        "<b> Evapotranspiración (mm): </b>" + feature.properties.Evapotrans + "<br>" +
        "<b> Limitación Geológica : </b>" + feature.properties.Geological + "<br>" +
         "<br>" +
        // "<b> <i>Fuente de Información:  </b>  INDEC - Censo 2010<br>" +
        // "<b> Fecha de actualización:  </b> - </i>" +
        "</div>"
    )
};
// Función para generar la leyenda
function createLegendAgri() {
    var legend = L.control({ position: 'bottomright' });

    legend.onAdd = function () {
        var div = L.DomUtil.create('div', 'info legend');
        var labels = [];
        var styles = [
            { label: 'Puntos de AGRI', color: '' },
            { label: ' ', color: '#1f78b4' },
                    
            // Agrega aquí el resto de estilos con su respectiva etiqueta y color
        ];

        // Genera el contenido HTML de la leyenda
        styles.forEach(function (style) {
            labels.push(
                '<i style="background:' + style.color + '"></i> ' + style.label
            );
        });

        div.innerHTML = labels.join('<br>');
        return div;
    };

    // Función para mostrar/ocultar la leyenda
    function toggleLegend() {
        if (map.hasLayer(PuntosAgri)) {
            legend.addTo(map);
        } else {
            legend.remove();
        }
    }
// Eliminar la leyenda al inicio
legend.remove();
    // Escucha el cambio de estado de la capa
    map.on('overlayadd overlayremove', toggleLegend);
}

